    for c in t:
        for r in c:
            print("{0:d}".format(r),end="")
        print("")

def play(t,x,y):
    q = [[x,y]]
    while True:
        p = q.pop(0)

        x = p[0]
        y = p[1]

        t[y][x] = 0
        for i in range(1,4):
            if x+i < 8:
                if t[y][x+i] == 1:
                    q.append([x+i,y])
                    t[y][x+i] = 0
            if x-i >= 0:
                if t[y][x-i] == 1:
                    q.append([x-i,y])
                    t[y][x-i] = 0
            if y+i < 8:
                if t[y+i][x] == 1:
                    q.append([x,y+i])
                    t[y+i][x] = 0
            if y-i >= 0:
                if t[y-i][x] == 1:
                    q.append([x,y-i])
                    t[y-i][x] = 0

        if q == []:
            break
    return t

